// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract AdvancedNFTMarketplace is ERC721, Ownable, ReentrancyGuard {
    uint256 private _tokenIds;

    // Marketplace variables
    uint256 public marketplaceFee;              // Fee percentage (e.g., 250 = 2.5%)
    uint256 public constant FEE_PRECISION = 10000; // For percentage calculations
    address public feeRecipient;                // Where marketplace fees go

    // Dynamic pricing variables
    uint256 public basePrice;                   // Base price in wei
    uint256 public totalSupply;                 // Maximum NFT supply
    uint256 public maxPerWallet;                // Max NFTs per wallet
    uint256 public priceAdjustmentInterval;     // Time between adjustments
    uint256 public lastAdjustmentTime;          // Last price update timestamp
    uint256 public constant PRECISION = 1e18;   // For decimal precision

    // Dynamic pricing factors
    uint256 public demandMultiplier;            // Demand sensitivity
    uint256 public scarcityMultiplier;          // Supply sensitivity
    uint256 public timeDelayFactor;             // Price decay over time

    // Rarity and Royalties
    enum Rarity { Common, Rare, Epic, Legendary }
    mapping(uint256 => Rarity) public tokenRarity;
    mapping(Rarity => uint256) public rarityMultiplier;
    mapping(uint256 => uint256) public tokenRoyalties; // Royalty percentage per token (e.g., 1000 = 10%)
    mapping(uint256 => address) public royaltyRecipient; // Who gets royalties

    // Marketplace listings
    struct Listing {
        uint256 tokenId;
        uint256 price;
        address seller;
        bool active;
    }
    mapping(uint256 => Listing) public listings;

    // Auction functionality
    struct Auction {
        uint256 tokenId;
        uint256 startingPrice;
        uint256 endingPrice;
        uint256 duration;
        uint256 startTime;
        address highestBidder;
        uint256 highestBid;
        bool active;
    }
    mapping(uint256 => Auction) public auctions;

    // Tracking
    mapping(address => uint256) public walletPurchases;
    mapping(uint256 => uint256) public tokenMintTime;

    event NFTMinted(uint256 tokenId, address recipient, uint256 price, Rarity rarity, uint256 royalty);
    event PriceAdjusted(uint256 newBasePrice, uint256 timestamp);
    event Listed(uint256 tokenId, uint256 price, address seller);
    event Purchased(uint256 tokenId, address buyer, uint256 price);
    event AuctionStarted(uint256 tokenId, uint256 startingPrice, uint256 duration);
    event BidPlaced(uint256 tokenId, address bidder, uint256 amount);
    event AuctionEnded(uint256 tokenId, address winner, uint256 amount);

    constructor(
        uint256 _basePrice,
        uint256 _totalSupply,
        uint256 _maxPerWallet,
        uint256 _demandMultiplier,
        uint256 _scarcityMultiplier,
        uint256 _timeDelayFactor,
        uint256 _adjustmentInterval,
        uint256 _marketplaceFee,
        address _feeRecipient
    ) ERC721("AdvancedNFTMarket", "ANFT") Ownable(msg.sender) {
        basePrice = _basePrice;
        totalSupply = _totalSupply;
        maxPerWallet = _maxPerWallet;
        demandMultiplier = _demandMultiplier;
        scarcityMultiplier = _scarcityMultiplier;
        timeDelayFactor = _timeDelayFactor;
        priceAdjustmentInterval = _adjustmentInterval;
        lastAdjustmentTime = block.timestamp;
        marketplaceFee = _marketplaceFee;
        feeRecipient = _feeRecipient;

        // Initialize rarity multipliers (in percentage)
        rarityMultiplier[Rarity.Common] = 100;      // 1x
        rarityMultiplier[Rarity.Rare] = 150;        // 1.5x
        rarityMultiplier[Rarity.Epic] = 300;        // 3x
        rarityMultiplier[Rarity.Legendary] = 500;   // 5x
    }

    // --- Dynamic Pricing ---

    function getCurrentPrice(Rarity _rarity) public view returns (uint256) {
        uint256 currentSupply = _tokenIds;
        if (currentSupply >= totalSupply) return basePrice;

        // Demand factor
        uint256 demandFactor = (currentSupply * demandMultiplier * PRECISION) / totalSupply;

        // Scarcity factor
        uint256 leftoverSupply = totalSupply - currentSupply;
        uint256 scarcityFactor = (totalSupply * scarcityMultiplier * PRECISION) / leftoverSupply;

        // Time decay factor
        uint256 timeSinceLast = block.timestamp - lastAdjustmentTime;
        uint256 decay = (timeSinceLast * timeDelayFactor * basePrice) / (PRECISION * 24 hours);
        uint256 timeAdjustedPrice = basePrice > decay ? basePrice - decay : basePrice;

        // Combine factors
        uint256 dynamicPrice = timeAdjustedPrice * 
            (PRECISION + demandFactor + scarcityFactor) / 
            PRECISION;

        return (dynamicPrice * rarityMultiplier[_rarity]) / 100;
    }

    function adjustBasePrice(uint256 _newPrice) external onlyOwner {
        basePrice = _newPrice;
        lastAdjustmentTime = block.timestamp;
        emit PriceAdjusted(basePrice, block.timestamp);
    }

    // --- Minting ---

    function mintNFT(Rarity _rarity, uint256 _royaltyPercentage) external payable nonReentrant {
        require(_tokenIds < totalSupply, "Supply exhausted");
        require(walletPurchases[msg.sender] < maxPerWallet, "Wallet limit reached");
        require(_royaltyPercentage <= 2500, "Royalty cannot exceed 25%"); // Max 25%

        uint256 price = getCurrentPrice(_rarity);
        require(msg.value >= price, "Insufficient payment");

        _tokenIds++;
        uint256 newTokenId = _tokenIds;

        _safeMint(msg.sender, newTokenId);
        tokenRarity[newTokenId] = _rarity;
        tokenRoyalties[newTokenId] = _royaltyPercentage;
        royaltyRecipient[newTokenId] = msg.sender;
        tokenMintTime[newTokenId] = block.timestamp;
        walletPurchases[msg.sender]++;

        lastAdjustmentTime = block.timestamp;

        if (msg.value > price) {
            payable(msg.sender).transfer(msg.value - price);
        }

        emit NFTMinted(newTokenId, msg.sender, price, _rarity, _royaltyPercentage);
    }

    // --- Marketplace ---

    function listNFT(uint256 _tokenId, uint256 _price) external {
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        require(_price > 0, "Price must be greater than 0");
        require(!listings[_tokenId].active, "Already listed");
        require(!auctions[_tokenId].active, "In auction");

        _transfer(msg.sender, address(this), _tokenId);
        listings[_tokenId] = Listing({
            tokenId: _tokenId,
            price: _price,
            seller: msg.sender,
            active: true
        });

        emit Listed(_tokenId, _price, msg.sender);
    }

    function buyNFT(uint256 _tokenId) external payable nonReentrant {
        Listing memory listing = listings[_tokenId];
        require(listing.active, "Not listed");
        require(msg.value >= listing.price, "Insufficient payment");

        uint256 royaltyAmount = (listing.price * tokenRoyalties[_tokenId]) / FEE_PRECISION;
        uint256 feeAmount = (listing.price * marketplaceFee) / FEE_PRECISION;
        uint256 sellerAmount = listing.price - royaltyAmount - feeAmount;

        listings[_tokenId].active = false;

        // Transfer funds
        payable(royaltyRecipient[_tokenId]).transfer(royaltyAmount);
        payable(feeRecipient).transfer(feeAmount);
        payable(listing.seller).transfer(sellerAmount);

        // Transfer NFT
        _transfer(address(this), msg.sender, _tokenId);

        if (msg.value > listing.price) {
            payable(msg.sender).transfer(msg.value - listing.price);
        }

        emit Purchased(_tokenId, msg.sender, listing.price);
    }

    function cancelListing(uint256 _tokenId) external {
        Listing memory listing = listings[_tokenId];
        require(listing.active, "Not listed");
        require(listing.seller == msg.sender, "Not the seller");

        listings[_tokenId].active = false;
        _transfer(address(this), msg.sender, _tokenId);
    }

    // --- Auctions ---

    function startAuction(
        uint256 _tokenId,
        uint256 _startingPrice,
        uint256 _endingPrice,
        uint256 _duration
    ) external {
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        require(_startingPrice > _endingPrice, "Invalid price range");
        require(!auctions[_tokenId].active, "Auction already active");
        require(!listings[_tokenId].active, "NFT is listed");

        _transfer(msg.sender, address(this), _tokenId);
        auctions[_tokenId] = Auction({
            tokenId: _tokenId,
            startingPrice: _startingPrice,
            endingPrice: _endingPrice,
            duration: _duration,
            startTime: block.timestamp,
            highestBidder: address(0),
            highestBid: 0,
            active: true
        });

        emit AuctionStarted(_tokenId, _startingPrice, _duration);
    }

    function getAuctionPrice(uint256 _tokenId) public view returns (uint256) {
        Auction memory auction = auctions[_tokenId];
        require(auction.active, "No active auction");

        uint256 timeElapsed = block.timestamp - auction.startTime;
        if (timeElapsed >= auction.duration) return auction.endingPrice;

        uint256 priceRange = auction.startingPrice - auction.endingPrice;
        uint256 priceDrop = (priceRange * timeElapsed) / auction.duration;
        return auction.startingPrice - priceDrop;
    }

    function bid(uint256 _tokenId) external payable nonReentrant {
        Auction storage auction = auctions[_tokenId];
        require(auction.active, "Auction not active");
        uint256 currentPrice = getAuctionPrice(_tokenId);
        require(msg.value >= currentPrice, "Bid too low");
        require(block.timestamp < auction.startTime + auction.duration, "Auction ended");

        if (auction.highestBidder != address(0)) {
            payable(auction.highestBidder).transfer(auction.highestBid);
        }

        auction.highestBidder = msg.sender;
        auction.highestBid = msg.value;

        emit BidPlaced(_tokenId, msg.sender, msg.value);
    }

    function endAuction(uint256 _tokenId) external nonReentrant {
        Auction storage auction = auctions[_tokenId];
        require(auction.active, "Auction not active");
        require(block.timestamp >= auction.startTime + auction.duration || 
                msg.sender == ownerOf(_tokenId) || msg.sender == owner(), "Auction not ended");

        auction.active = false;
        if (auction.highestBidder != address(0)) {
            uint256 royaltyAmount = (auction.highestBid * tokenRoyalties[_tokenId]) / FEE_PRECISION;
            uint256 feeAmount = (auction.highestBid * marketplaceFee) / FEE_PRECISION;
            uint256 sellerAmount = auction.highestBid - royaltyAmount - feeAmount;

            payable(royaltyRecipient[_tokenId]).transfer(royaltyAmount);
            payable(feeRecipient).transfer(feeAmount);
            payable(ownerOf(_tokenId)).transfer(sellerAmount);

            _transfer(address(this), auction.highestBidder, _tokenId);
            emit AuctionEnded(_tokenId, auction.highestBidder, auction.highestBid);
        } else {
            _transfer(address(this), ownerOf(_tokenId), _tokenId);
            emit AuctionEnded(_tokenId, address(0), 0);
        }
    }

    // --- Admin Functions ---

    function setMarketplaceFee(uint256 _newFee) external onlyOwner {
        require(_newFee <= 1000, "Fee cannot exceed 10%");
        marketplaceFee = _newFee;
    }

    function setFeeRecipient(address _newRecipient) external onlyOwner {
        require(_newRecipient != address(0), "Invalid address");
        feeRecipient = _newRecipient;
    }

    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }

    // --- View Functions ---

    function _remainingSupply() public view returns (uint256) {
        return totalSupply - _tokenIds;
    }

    function getTokenDetails(uint256 _tokenId) external view returns (
        Rarity rarity,
        uint256 royalty,
        address royaltyRecipient_,
        uint256 mintTime
    ) {
        // require(_exists(_tokenId), "Token does not exist");
        return (
            tokenRarity[_tokenId],
            tokenRoyalties[_tokenId],
            royaltyRecipient[_tokenId],
            tokenMintTime[_tokenId]
        );
    }
}

