// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

contract NDTM is Ownable, ERC721URIStorage {
    uint256 private _tokenIds;

    // Marketplace variables
    uint256 public marketplaceFee; // Fee percentage (e.g., 250 = 2.5%)
    uint256 public constant FEE_PRECISION = 10000; // For percentage calculations
    address payable public feeRecipient; // Where marketplace fees go

    // Auction structure
    struct Auction {
        address seller;
        uint256 startingPrice;
        uint256 currentPrice;
        uint256 endTime;
        bool isActive;
    }

    mapping(uint256 => Auction) public auctions; // NFT tokenId to Auction

    // Event declarations
    event NFTMinted(uint256 indexed tokenId, address indexed owner, string tokenURI);
    event NFTListed(uint256 indexed tokenId, address indexed seller, uint256 price);
    event NFTSold(uint256 indexed tokenId, address indexed buyer, uint256 price);
    event AuctionCreated(uint256 indexed tokenId, uint256 startingPrice, uint256 endTime);
    event AuctionBid(uint256 indexed tokenId, address indexed bidder, uint256 amount);
    event AuctionEnded(uint256 indexed tokenId, address indexed winner, uint256 amount);

    constructor(
        string memory name, 
        string memory symbol, 
        address payable _feeRecipient, 
        uint256 _marketplaceFee
    ) 
        ERC721(name, symbol) Ownable(msg.sender) 
    {
        feeRecipient = _feeRecipient;
        marketplaceFee = _marketplaceFee;
    }

    // Minting NFT
    function mintNFT(
        string memory tokenURI
    ) public returns (uint256) {
        _tokenIds++;
        _mint(msg.sender, _tokenIds);
        _setTokenURI(_tokenIds, tokenURI);
        emit NFTMinted(_tokenIds, msg.sender, tokenURI);
        return _tokenIds;
    }

    // Listing NFT for sale
    function listNFT(uint256 tokenId, uint256 price) public {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(price > 0, "Price must be greater than zero");

        // Transfer the NFT to the marketplace
        _transfer(msg.sender, address(this), tokenId);

        emit NFTListed(tokenId, msg.sender, price);
    }

    // Buying NFT
    function buyNFT(uint256 tokenId) public payable {
        uint256 price = auctions[tokenId].currentPrice;
        require(msg.value >= price, "Insufficient funds sent");
        require(auctions[tokenId].isActive, "Auction not active");

        // Calculate the fee
        uint256 fee = (msg.value * marketplaceFee) / FEE_PRECISION;
        uint256 sellerAmount = msg.value - fee;

        // Transfer the funds
        payable(feeRecipient).transfer(fee);
        payable(ownerOf(tokenId)).transfer(sellerAmount);

        // Transfer the NFT to the buyer
        _transfer(address(this), msg.sender, tokenId);

        emit NFTSold(tokenId, msg.sender, price);
    }

    // Create an auction
    function createAuction(uint256 tokenId, uint256 startingPrice, uint256 duration) public {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(duration > 0, "Duration must be greater than zero");

        auctions[tokenId] = Auction({
            seller: msg.sender,
            startingPrice: startingPrice,
            currentPrice: startingPrice,
            endTime: block.timestamp + duration,
            isActive: true
        });

        emit AuctionCreated(tokenId, startingPrice, auctions[tokenId].endTime);
    }

    // Bid on an auction
    function bid(uint256 tokenId) public payable {
        Auction storage auction = auctions[tokenId];
        require(auction.isActive, "Auction not active");
        require(block.timestamp < auction.endTime, "Auction has ended");
        require(msg.value > auction.currentPrice, "Bid must be higher than current price");

        // Refund the previous bidder
        if (auction.currentPrice > 0) {
            payable(auction.seller).transfer(auction.currentPrice);
        }

        // Update the current price and the seller
        auction.currentPrice = msg.value;

        emit AuctionBid(tokenId, msg.sender, msg.value);
    }

    // End the auction
    function endAuction(uint256 tokenId) public {
        Auction storage auction = auctions[tokenId];
        require(block.timestamp >= auction.endTime, "Auction has not ended yet");
        require(auction.isActive, "Auction not active");

        auction.isActive = false;

        if (auction.currentPrice > 0) {
            // Transfer NFT to the highest bidder
            _transfer(address(this), msg.sender, tokenId); // Replace msg.sender with the highest bidder's address in a real implementation
            emit AuctionEnded(tokenId, msg.sender, auction.currentPrice);
        } else {
            // If no bids were placed, transfer NFT back to the seller
            _transfer(address(this), auction.seller, tokenId);
        }
    }

    // Withdraw marketplace fees by the owner
    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(owner()).transfer(balance);
    }

    // Update marketplace fee
    function updateMarketplaceFee(uint256 _marketplaceFee) external onlyOwner {
        marketplaceFee = _marketplaceFee;
    }

    // Update fee recipient
    function updateFeeRecipient(address payable _feeRecipient) external onlyOwner {
        feeRecipient = _feeRecipient;
    }
}

